INSERT INTO `tbl_post` (`id`, `title`, `content`, `tags`, `status`, `create_time`, `update_time`, `author_id`) VALUES
(1, 'Welcome!', 'This blog system is developed using Yii. It is meant to demonstrate how to use Yii to build a complete real-world application. Complete source code may be found in the Yii releases.\r\n\r\nFeel free to try this system by writing new posts and posting comments.', 'yii, blog', 3, 1230952187, 1349067776, 1),
(5, 'Welcome!', 'Welcome to a pointless site', 'development', 2, 1349062988, 1349064578, 2),
(6, 'HTML Escape Special Chars Wrapper Class', 'So the other day I stuck this in the main Object-relational mapping class. \r\nBasically I couldn''t stand that all the members of the class could only be retrieved using a getter.\r\nAlso I''m very used to using MyActive record.\r\n\r\n  /**\r\n   * If a member variable isn''t found it will try to get it from __fields\r\n   */\r\n  public function __get($name)\r\n  {\r\n    $str_get_function_name=''get__''.$name;\r\n\r\n    //Use getters if they exist\r\n    if(method_exists($this,$str_get_function_name)) {\r\n      return $this->$str_get_function_name();\r\n\r\n    //Use the get function if a that field were looking for is in __fields\r\n    } else if (array_key_exists($name, $this->__fields)) {\r\n      return $this->get($name);\r\n    }\r\n  }\r\n\r\nI mean why make an ORM class and try to keep all the members protected. If you intend to create a getter and setter for each and every protected member.\r\nI thought the point of it was to make it easy to get an object oriented representation of a record. But thats not the rant/point of this specific post. I had an interesting idea while I was doing all this.\r\n\r\n  /**\r\n   *\r\n   */\r\n  Class HTMLEscapeSpecialCharsWrapper()\r\n  {\r\n    protected $obj_data;\r\n\r\n    /**\r\n     *\r\n     */\r\n    function __construct($obj_data_param) {\r\n      $this->obj_data = $obj_data_param;\r\n    }\r\n\r\n    public function __get($name)\r\n    {\r\n      $str_get_function_name=''get''.$name;\r\n\r\n      //Use getters if they exist\r\n      if(method_exists($this,$str_get_function_name)) {\r\n        return $this->$str_get_function_name();\r\n\r\n      //Use the get function if a that field were looking for is in __fields\r\n      } else {\r\n        return htmlspecialchars($this->obj_data->$name);\r\n      }\r\n    }\r\n  }\r\n\r\n\r\nSo you can do this \r\n\r\n$purchase = new HTMLEscapeSpecialCharsWrapper(new Purchase($id));\r\n\r\n/*view code here*/\r\n\r\nYou can also use the same idea when extending. \r\nBut really the main advantage is you can reuse this idea for other things. Like lets say you had to change a user profile page and you needed to add something to each and every field that shows up in the view.\r\nWell then just add a __get to your UserView class and do that instead spending hours trying to make sure you got every field in the smarty template.', 'programming', 2, 1350342121, 1350342186, 2);
